import React, { useState } from 'react';

const ContactForm = () => {
  const [formData, setFormData] = useState({
    contactType: '',
    contactInfo: '',
    phone: '',
    email: '',
    clock: '',
  });

  const [errorMessage, setErrorMessage] = useState('');

  // Handle input changes for form fields
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  // Validate form inputs
  const validateForm = () => {
    let errors = '';
    const { contactType, contactInfo, phone, email } = formData;

    // Validate dropdown selection
    if (!contactType) {
      errors += 'Please select a contact method.\n';
    }

    // Validate contact info (only needed for WhatsApp, Instagram, or Facebook)
    if (
      (contactType === 'whatsapp' || contactType === 'instagram' || contactType === 'facebook') &&
      !contactInfo
    ) {
      errors += 'Please enter your contact info (username/link).\n';
    }

    // Validate phone number: must be 10 digits
    if (phone && !/^\d{10}$/.test(phone)) {
      errors += 'Phone number must be exactly 10 digits.\n';
    }

    // Validate email: basic email format check
    if (email && !/\S+@\S+\.\S+/.test(email)) {
      errors += 'Please enter a valid email address.\n';
    }

    return errors;
  };

  // Handle form submission
  const handleSubmit = (e) => {
    e.preventDefault();

    const errors = validateForm();
    if (errors) {
      setErrorMessage(errors);
    } else {
      setErrorMessage('');
      alert('Form submitted successfully!');
      // Additional actions can go here (e.g., API calls)
    }
  };

  return (
    <div>
      <h1>Contact Form</h1>
      <form onSubmit={handleSubmit}>
        {/* Contact Type Dropdown */}
        <div>
          <label htmlFor="contact-type">Contact Type:</label>
          <select
            id="contact-type"
            name="contactType"
            value={formData.contactType}
            onChange={handleChange}
          >
            <option value="">Select contact method</option>
            <option value="whatsapp">WhatsApp</option>
            <option value="instagram">Instagram</option>
            <option value="facebook">Facebook</option>
            <option value="location">Location</option>
            <option value="phone">Phone Number</option>
            <option value="email">Email</option>
            <option value="clock">Available Time</option>
          </select>
        </div>

        {/* Contact Info */}
        {formData.contactType && (formData.contactType === 'whatsapp' || formData.contactType === 'instagram' || formData.contactType === 'facebook') && (
          <div>
            <label htmlFor="contact-info">Contact Info (Username/Link):</label>
            <input
              type="text"
              id="contact-info"
              name="contactInfo"
              value={formData.contactInfo}
              onChange={handleChange}
              placeholder="Enter contact details (username or link)"
            />
          </div>
        )}

        {/* Phone Number */}
        {formData.contactType === 'phone' && (
          <div>
            <label htmlFor="phone">Phone Number:</label>
            <input
              type="tel"
              id="phone"
              name="phone"
              pattern="^\d{10}$"
              value={formData.phone}
              onChange={handleChange}
              placeholder="Enter 10-digit phone number"
            />
          </div>
        )}

        {/* Email */}
        {formData.contactType === 'email' && (
          <div>
            <label htmlFor="email">Email:</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              placeholder="Enter your email"
            />
          </div>
        )}

        {/* Available Time */}
        {formData.contactType === 'clock' && (
          <div>
            <label htmlFor="clock">Available Time:</label>
            <input
              type="time"
              id="clock"
              name="clock"
              value={formData.clock}
              onChange={handleChange}
            />
          </div>
        )}

        <button type="submit">Submit</button>
      </form>

      {errorMessage && (
        <div style={{ color: 'red', marginTop: '10px' }}>
          <pre>{errorMessage}</pre>
        </div>
      )}
    </div>
  );
};

const contactManagement = () => {
  return (
    <div className="App">
      <ContactForm />
    </div>
  );
};

export default contactManagement;
